DROP TABLE IF EXISTS `spc_data_summary`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `spc_data_summary` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `lot_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '批次号',
  `data_time` datetime NOT NULL COMMENT '数据时间',
  `param_key` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '参数组名',
  `mean` double(9,3) DEFAULT NULL COMMENT '平均值',
  `mid` double(9,3) DEFAULT NULL COMMENT '中位数',
  `range_span` double(9,3) DEFAULT NULL COMMENT '极差',
  `std` double(9,3) DEFAULT NULL COMMENT '标准差',
  `max` double(9,3) DEFAULT NULL COMMENT '最大值',
  `min` double(9,3) DEFAULT NULL COMMENT '最小值',
  `sample_size` int DEFAULT NULL COMMENT '样本容量',
  `tool_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '过滤条件:设备号,可选',
  `recipe_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '过滤条件:配方号,可选',
  `product_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '过滤条件:产品号,可选',
  `site_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '过滤条件:站点号_可选',
  `process_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '过滤条件:工艺号_可选',
  `extra1_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预留字段1_可选',
  `extra2_id` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '预留字段2_可选',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手动注释值',
  `valid_flag` tinyint(1) DEFAULT '1' COMMENT '有效标记(即隐藏操作) 0.不显示 1.显示',
  `q1` double(9,3) DEFAULT NULL COMMENT '第一四分位数(下四分位数)',
  `q3` double(9,3) DEFAULT NULL COMMENT '第三四分位数(上四分位数)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_klt` (`lot_id`,`data_time`,`param_key`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='数据汇总表\n同一个lot,在同一时间,同一参数只有一笔记录,汇总此表数据时,如出现多笔记录,则取最新的一次量测结果';
